import React from "react";
import { BrowserRouter as Router, Link, Route, Switch } from "react-router-dom";
import TodoApp from "./TodoApp";
import HackerNewStories from "./HackerNewStories";

export const App = () => {
  return (
    <Router>
      <div>
        <ul>
          <li>
            <Link to="/">Home </Link>
          </li>
          <li>
            <Link to="/todo-app">Todo App </Link>
          </li>
          <li>
            <Link to="/stories-app">Hacker News Stories App </Link>
          </li>
        </ul>

        <Switch>
          <Route path="/todo-app">
            <TodoApp />
          </Route>
          <Route path="/stories-app">
            <HackerNewStories />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
  );
};

export default App;

export const Home = () => {
  return <div>My Router</div>;
};
